import './App.css';
import Todos from './components/Todos'

function App() {
  State = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Take out the trash again',
        completed: false
      },
      {
        id: 3,
        title: 'Take out the trash agina again',
        completed: false
      },
      {
        id: 4,
        title: 'Take out the trash aoweifaoi',
        completed: false
      },
    ]
  }
  return (
    <div className="App">
      <Todos>
        todos={this.State.todos}
      </Todos>
    </div>
  );
}

export default App;
